import React from "react";
import PropTypes from "prop-types";
import { Link } from "react-router-dom";

const UserItem = ({ user: { title, avatar_url, html_url } }) => {
  return (
    <div className="card text-center">
      {/* <img
        src={avatar_url}
        className="round-img"
        style={{ width: "60px" }}
        alt=""
      /> */}
      <h3>{title}</h3>

      <div>
        <Link to={`/user/${title}`} className="btn btn-dark btn-sm my-1">
          More
        </Link>
      </div>
    </div>
  );
};
UserItem.propTypes = {
  user: PropTypes.object.isRequired,
};
export default UserItem;
